import { Link } from "react-router-dom";
import Dogs1 from "../../Assets/Dogs1.png";
import IconPaw from "../../Assets/IconPaw.png";
import logo from "../../Assets/doggoApiLogoBlack.png";
import "./LandingPage.modules.css";

const LandingPage = () => {
    return (
        <><div>
            <div className="landingBar">
                <img src={logo} alt="Doggo Api Logo" className="logo" />
                <h1 className="landingTitle">Welcome to DoggoApi</h1>
            </div>

            <div className="bodyLanding">

                <div className="landingText">
                    "Discover the canine universe: All breeds on a single page"
                </div>

                <img src = {Dogs1} alt = "" className = "PortraitLanding"/>

                <Link to = {`/Dogs`}>
                    <button className = "enter-button" style = {{ display: 'flex', alignItems: 'center' }}>
                    <img src = {IconPaw} alt = "iconPaw" className = "iconPaw" />
                        <span style = {{ marginLeft: '50px' }}> Enter </span>
                    </button>
                </Link>

            </div>
            </div>
        </>
    )
}

export default LandingPage;
